import React, { PureComponent } from 'react';
import { withRouter, Link } from 'react-router-dom';

import Radial from "../../Chart/Radial";
import RadialGradient from "../../Chart/RadialGradient";
import RadialSemiCircle from "../../Chart/RadialSemiCircle";
import RadialStroked from "../../Chart/RadialStroked";

type State = {

}

type Props = {
    dashboardState : Object,
    fetchDashboard: Function,
    resetDashboard: Function
}

class DashboardContainer extends PureComponent<Props, State> {

  constructor(props: Props, context: Context) {
    super(props, context);
    this.state = {
     }
  }


  componentWillMount() {
    console.log('componentWillMount');
    const {fetchDashboard, resetDashboard } = this.props;
    fetchDashboard();
  }
  componentDidMount() {
    console.log('componentDidMount');
    this.props.fetchDashboard('all');
  }

  render() {
    const { fetchDashboard, resetDashboard, dashboardState } = this.props;
    return (

        <React.Fragment>
            <div >
                <p>DASHBOARD</p>
            </div>
            <br/>
            <div>

              <div className="mt-inner">

                   <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[82]}
                        label={['Temperature', '2021-10-24 5:00 AM']}
                        unit={'Farenheiht'}
                      />
                      </div>
                    </div>
                  </div>

                   <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[80]}
                        label={['Pressure (psi)']}
                        unit={'psi'}
                      />
                      </div>
                    </div>
                  </div>


                   <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[1013]}
                        label={['Altitude (mbar)']}
                        unit={'mbar'}
                      />
                      </div>
                    </div>
                  </div>

                   <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[38.3]}
                        label={['Humidity']}
                        unit={''}
                      />
                      </div>
                    </div>
                  </div>

                  <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[10]}
                        label={['Soil Moisture (%)']}
                        unit={'percent'}
                      />
                      </div>
                    </div>
                  </div>

                  <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[1500]}
                        label={['Light Intensity (lux)']}
                        unit={'lux'}
                      />
                      </div>
                    </div>
                  </div>

                  <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[12]}
                        label={['Flow Meter (per min)']}
                        unit={'per min'}
                      />
                      </div>
                    </div>
                  </div>

                   <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[24]}
                        label={['Nitrogen (mg/dL)']}
                        unit={'mg/dL'}
                      />
                      </div>
                    </div>
                  </div>

                   <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[4.5]}
                        label={['Phosphorous (mg/dL)']}
                        unit={'mg/dL'}
                      />
                      </div>
                    </div>
                  </div>

                  <div class="div-dash">
                    <div class="row rptpad div-dash-head">
                      <div class="row st-no-pad-no-margin">
                      <RadialStroked
                        series={[103]}
                        label={['Potassium (ppm)']}
                        unit={'ppm'}
                      />
                      </div>
                    </div>
                  </div>
              </div>
            </div>
        </React.Fragment>
    );
  }
}

export default withRouter(DashboardContainer);
